import React from "react";

const Page404 = () => (
  <div className="ed-grid">
    <div className={styles.NotFoundContainer}>
      <img className={styles.error404} src={NotFoundImage} alt="Not Found" />
      <Link className={styles.regresar} to="/">
        Regresar
      </Link>
    </div>
  </div>
);

export default Page404;
